 <span style="color: rgb(121, 0, 0); font-family: Tahoma; font-size: x-large;"></span><span class="LineHeight1-5"><span style="font-size: 14px;"><strong><font size="2" face="Verdana">          Группа транспортных компаний «Байт Транзит»</font></strong><font size="2" face="Verdana"> – крупный холдинг в сфере транспортно-логистических услуг в Новосибирском регионе. Находясь в центре Сибири, компания предоставляет полный комплекс услуг глобальной и региональной логистики. </font></span><font size="2" face="Verdana"> </font></span> 
  <p style="text-align: justify;"><font size="2" face="Verdana"><span class="LineHeight1-5"><span style="font-size: 14px;">        Из небольшого предприятия, состоящего из нескольких человек, всего за четверть века, компания выросла до большого холдинга, в составе которого несколько компаний. За эти годы ГК «Байт Транзит» отработаны и выверены эффективные и оптимальные схемы грузоперевозок, как по России, так и международных. Грузоперевозки осуществляются в любых объемах и любым видом транспорта:  железнодорожным, автомобильным, контейнерным, морским или воздушным.</span></span></font></p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5"> </span></font></p>
 
  <p style="text-align: justify;"><font size="2" face="Verdana"><span class="LineHeight1-5"><span style="font-size: 14px;">     Обладая собственным багажным железнодорожным парком вагонов и парком специализированных автомобилей, ГК «Байт Транзит» оперативно разрабатывает оптимальные схемы комплексной перевозки и осуществляет доставку по принципу «от двери до двери» на любые расстояния в кратчайшие сроки.</span></span></font></p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5"> </span></font></p>
 
  <p style="text-align: justify;"><font size="2" face="Verdana"><span class="LineHeight1-5"><span style="font-size: 14px;">В Новосибирске компания располагает собственными многофункциональными грузовыми терминалами, в том числе таможенным складом СВХ (временного хранения таможенных грузов), который имеет выгодное географическое положение, находясь по соседству с грузовой станцией Клещиха.</span></span></font></p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5"> </span></font></p>
 
  <p style="text-align: justify;"><font size="2" face="Verdana"><span class="LineHeight1-5"><span style="font-size: 14px;">      Под управлением ГК «Байт Транзит» работают обособленные подразделения во многих городах России и стран Евросоюза.</span></span></font></p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5"> </span></font></p>
 
  <p style="text-align: justify;"><font size="2" face="Verdana"><span class="LineHeight1-5"><span style="font-size: 14px;">В портфеле клиентов компании более 4000 фирм только по Новосибирску и Новосибирской области, что говорит о надежности ГК «Байт Транзит».</span></span></font></p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5"> </span></font></p>
 
  <p style="text-align: justify;"> </p>
 
  <p><font size="2" face="Verdana"><span class="LineHeight1-5">        С 1995 года компания трижды получала единственную в России лицензию <strong style="font-size: 14px;">Общероссийского таможенного перевозчика </strong></span><span style="font-size: 14px;"><span class="LineHeight1-5">на два вида транспорта (железнодорожный и автомобильный).</span></span></font></p>
 
